# Do not edit this!!!
# This is a file that containts some metadata from our CI Server to know if there is new updates available
# from our CI Server (if this is a testing build) or from the SpigotMC webpage (if this is a release build published at SpigotMC).
build {
  targetRelease="${target_release}"
  project="${build_job_name}"
  number="${build_id}"
  branch="${build_branch}"
  full-hash="${build_full_hash}"
  timestamp="${build_timestamp}"
  version="${build_version}"
}
